VectorXd Dynamics::get_tau_model(VectorXd q, VectorXd qd, VectorXd qdd){
    VectorXd tau_Model(7);
    
    VectorXd tau_G = get_tau_G(q);
    VectorXd tau_F = get_tau_F(qd);
    MatrixXd C = get_C(q,  qd);
    MatrixXd M = get_M(q);

    tau_Model << tau_G +tau_F + M*qdd + C*qd;

    return (tau_Model);   
};

